  return (
    <div class="mx-auto">
      <div class="card game-profile">
        <div class="card-body">
          <h5 class="card-title">{Props.name}</h5>
          <p class="card-text">Categories: {Props.ategory}</p>
          <a href="#" class="btn btn-primary">
            R$:{Props.category}
          </a>

          <a href="#" class="btn btn-danger delete-btn">
            Delete
          </a>
        </div>
      </div>
    </div>
  );
}
